import React from 'react'
import { Link } from 'react-router-dom';
import { ReactComponent as Add } from '../assets/add.svg';
const addButton = () => {
    return (
        <div>
            <Link to='note/new/' className='floating-button'>
                <Add />
            </Link>
        </div>
    )
}

export default addButton
